import axios from "axios";
import auth_header from "./auth_header";

export const userData = () => {
    return axios
        .get('http://localhost:3600/admin/')
        .then((response) => {
            if (response.data.tokenData.accessToken) localStorage.setItem("user", JSON.stringify(response.data.tokenData));
            return response.data;
        });
};
